       key ={personaje.id} 
       id = {personaje.id}
       name = {personaje.name} 
       onClose={personaje.onClose} 
       species={personaje.species} 
       gender = {props.gender} 
       origin={personaje.origin.name}
      image={personaje.image}/>
      ))};

 </div>);
}
